import React, { Component } from 'react';
import { bindActionCreators } from 'redux'; 
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';


class Filter extends Component {

	render(){
		return(
	     	<div className='bottom-shadow' style={{backgroundColor:'white'}}>
	     		<div style={{padding:'16px', backgroundColor:'rgb(252,252,252)'}}>
		     		<h6><strong>Filter 486 Items</strong></h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6 className='gray'><strong>Color</strong></h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6 className='gray'><strong>Size</strong></h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6 className='gray'><strong>Price Range</strong></h6>
	     		</div>

	     		<div style={{padding:'16px'}}>
	     			<h6 className='gray'><strong>Brand</strong></h6>
	     		</div>

	     		<div style={{padding:'16px', backgroundColor:'rgb(252,252,252)'}}>
	     			<button className='btn btn-sm btn-danger'>Apply</button>
	     			<span>Clear All</span>
	     		</div>
	     	</div>
		);
	}
}





export default Filter;
